	add("malkin", "{\"term\":\"malkin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Diminutive of Malde, an early form of Maude or Matilda. Compare \u0027grimalkin\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (stereotypical name for a) lower-class or uncultured woman; a kitchenmaid; a slattern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1385\u0027\u0027, \u0027Piers Plowman\u0027, I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ȝe ne haue na more meryte · in masse ne in houres / Þan \u0027\u0027Malkyn\u0027\u0027 of hire maydenhode · þat no man desireth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A mop, especially one used to clean a baker\u0027s oven\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027, \u0027s:An Antidote Against An Antidote Against Atheism\u0027, Book III, A Collection of Several Philosophical Writings of Dr. Henry More, p. 120\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;She had no sooner said so, but they all vanished saving onely one \u0027Peter Grospetter\u0027, whom a little after she saw snatch\u0027d up into the aire, and to let fall his \u0027\u0027Maulkin\u0027\u0027 (a stick that they make clean Ovens withall) and her self was also driven so forcibly with the wind, that it made her almost Lose her breath.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A mop or sponge attached to a jointed staff for swabbing out a cannon\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A scarecrow\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A cat\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Now she was strong enough to walk and watch them circling in the sky or to sit in the arbour at the end of the long lawn and, with the sunlight smouldering in her dark-red hair and lying wanly over the area of her face and neck, watch the multiform and snow-white convolutions of her \u0027\u0027malkins\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A hare\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Water Music\u0027, Penguin 2006, p. 158\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"There was milk punch and spiced whisky, a smell of goose and \u0027\u0027maukin\u0027\u0027 roasting on the spit\", \"priority\":13}]}, \"synonyms\":{}}");

