	add("mallee", "{\"term\":\"mallee\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"woiwurrung\"], \"text\":\"From Woiwurrung \u0027mali\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of scrubland with low-growing thick eucalypts, characteristic of certain parts of Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any semi-desert region of Australia where such scrub is the predominant vegetation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, EO Schlunke, \u0027The Village Hampden\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"‘They\u0027re going to lynch you, Regerson,’ Harry told him, grinning. ‘You\u0027d better take to the \u0027\u0027mallee\u0027\u0027 before they come for you\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber and Faber 2003, p. 365\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It made no difference that he had also invented several ploughs and a device for grubbing \u0027\u0027Mallee\u0027\u0027 country or that people had journeyed all the way from Melbourne to inspect them\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any of several low-growing eucalypts characteristic of such scrubland, especially , and\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The growth habit of certain eucalypt species that grow with multiple stems springing from an underground lignotuber, shared by species of related genera\", \"priority\":8}]}, \"synonyms\":{}}");

	add("mallemaroking", "{\"term\":\"mallemaroking\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Dutch\"], \"text\":\"Generally considered to derive from Dutch although a specific etymon in unclear. \u0027Century\u0027 and some other old dictionaries derive it from a confusion of two similar Dutch words, namely {{m|nl|*mallemerok||foolish woman}} (from {{m|nl|mal|malle|foolish}} + {{m|nl|*marok}}, from French {{m|fr|marotte||jester\u0027s sceptre}}) and {{m|nl|*mallemok||sailor of a whaling vessel}}, but the first of those words is not attested\u0026lt;!--or does not seem to be...--\u0026gt;, and the second is not attested with the claimed meaning (but see {{m|en|mollymawk}}). Compare {{m|nl|mallemolen}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Carousing on icebound Greenland whaling ships\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027\u0026lt;!--?--\u0026gt;, \u0027Punch\u0027, volume 235, page 319\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Just because I had one gin before and a couple of glasses of claret during you thought I\u0027d been \u0027\u0027mallemaroking\u0027\u0027.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Katrin Maria Kohl, ‎Ritchie Robertson, \u0027A History of Austrian Literature 1918-2000\u0027, page 243\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"they were willing to endure so much physical hardship out of loyalty to Emperor Franz Joseph. Indeed, such is their sense of duty that they even indulge in some muted \u0027\u0027mallemaroking\u0027\u0027 to celebrate the Emperor\u0027s birthday\", \"priority\":5}]}, \"synonyms\":{}}");

